export const circleData = [
    {
        percentage: 8,
        color: '#8BC34A',
        max: 10,
        radius: 120,
        texto: 'Casos Atendidos',
    },
    {
        percentage: 14,
        color: 'skyblue',
        max: 20,
        radius: 75,
        texto: 'Casos Reportados',
    },
    {
        percentage: 92,
        color: '#F6230A',
        max: 100,
        radius: 75,
        texto: 'Casos sin atender',
    }
]
